script: |
  super -f text -I q9558.spq | sort > q9558.out

inputs:
  - name: q9558.spq
    data: |
      SELECT - 7 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col0 NOT IN ( - 83 * - + col2 * col0 + - - col2 * + 9 * - - col2, 47 + 45, - col0 * - - col1, + 54 + - col2, 26 / + col2, - col2 / - + col0 * - - col2, + - col0 );
  - name: tab2

outputs:
  - name: q9558.out
    data: |
      -7
      -7
      -7
